const Zines = ({ zines }) => {
  return (
    <div>
      <h2>Zines</h2>
      <ul>
        {zines.map((zine) => (
          <li key={zine.id}>
            <h3>{zine.title}</h3>
            <h4>{zine.author}</h4>
            <p>{zine.description}</p>
            <h4>Images:</h4>
            <ul>
              {Array.isArray(zine.images) &&
                zine.images.map((image, index) => (
                  <li key={index}>
                    <img
                      src={image}
                      alt={`Image ${index + 1}`}
                      style={{ maxWidth: "100px", maxHeight: "100px" }}
                    ></img>
                  </li>
                ))}
            </ul>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Zines;
